package com.example.food.food;

import android.os.Bundle;
import androidx.appcompat.app.AppCompatActivity;
import androidx.recyclerview.widget.LinearLayoutManager;
import com.example.food.databinding.ActivityFoodBinding;

import java.util.ArrayList;

public class FoodActivity extends AppCompatActivity {

    private ActivityFoodBinding binding;
    private ArrayList<Food> foodList;
    private FoodAdapter adapter;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);

        binding = ActivityFoodBinding.inflate(getLayoutInflater());
        setContentView(binding.getRoot());

        binding.recyclerView.setLayoutManager(new LinearLayoutManager(this));

        foodList = new ArrayList<>();
        populateFoodList();

        adapter = new FoodAdapter(foodList);
        binding.recyclerView.setAdapter(adapter);
    }

    private void populateFoodList() {
        foodList.add(new Food("Пицца", "data:image/jpeg;base64,", "Итальянское блюдо с томатным соусом и сыром"));
        foodList.add(new Food("Бургер", "data:image/jpeg;base64,", "Американская классика с говяжьей котлетой"));
        foodList.add(new Food("Суши", "data:image/jpeg;base64,", "Традиционное японское блюдо"));
        foodList.add(new Food("Паста", "data:image/jpeg;base64,", "Паста с соусом из томатов и сыра"));
        foodList.add(new Food("Салат", "data:image/jpeg;base64,", "Свежий салат с овощами и заправкой"));
        foodList.add(new Food("Шаурма", "data:image/jpeg;base64,", "Шаурма с курицей и соусами"));
        foodList.add(new Food("Тосты", "data:image/jpeg;base64,", "Тосты с авокадо и помидорами"));
        foodList.add(new Food("Фалафель", "data:image/jpeg;base64,", "Фалафель с хумусом и овощами"));
        foodList.add(new Food("Куриные крылышки", "data:image/jpeg;base64,", "Крылышки в острых соусах"));
        foodList.add(new Food("Чили кон карне", "data:image/jpeg;base64,", "Острая говядина с фасолью и специями"));
    }
}